import React from "react";
import './links.css'
import './App.css';

function Apod({
name,
date,
copyright,
explanation,
img_url
}){
  return(
    <div className="Neo">
      <h1> Title:  {name} </h1>
      <p> Date: {date} </p>
      <p> Copyright:  {copyright} </p>
      <u> Description </u>
      <p> {explanation} </p>
      <img id="apod_image" src={img_url} alt="APOD" />
    </div>
  );
}

export default Apod;
